Function Invoke-Log4jScan {
    [cmdletbinding()]
    Param(
        [string[]]$ComputerName
    )

    begin {
        Write-Verbose "Invoke-Log4jScan initializing"

        if(-not (Test-Path C:\Temp)){
            $null = New-Item -Name Temp -Path C:\ -ItemType Directory -Force -ErrorAction SilentlyContinue
        }

        if (-Not ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole] 'Administrator')){
            if ([int](Get-CimInstance -Class Win32_OperatingSystem | Select-Object -ExpandProperty BuildNumber) -ge 6000) {
                if($PSCmdlet.ShouldContinue("Script not running as administrator. Would you like to run the script as administrator?","Run as administrator")){
                    Write-Verbose "Launching script as administrator"

                    Start-Process -FilePath PowerShell.exe -Verb Runas -ArgumentList $PSCommandPath
                    Exit
                }
                else{
                    Write-Warning "Script requires run as administrator"
                    break
                }
            }
            else{
                $PSVersion = "{0}.{1}" -f $('Major','Minor' | ForEach-Object {$PSVersionTable.PSVersion.$_})
                Write-Warning "Powershell version $PSVersion is outdated and not supported"
                break
            }
        }
        
        Write-Verbose "Gathering latest yara links from https://github.com/virustotal/yara/releases/latest"

        [Net.ServicePointManager]::SecurityProtocol = [Enum]::ToObject([Net.SecurityProtocolType], 3072)

        $yaralinks = @{}

        try{
            $yara = Invoke-WebRequest -Uri https://github.com/virustotal/yara/releases/latest -UseBasicParsing
        }
        catch{
            Write-Warning "Error querying yara github: $($_.exception.message)"
        }

        $yara.Links| where outerhtml -match "/Virus.+/(yara.+win(\d\d)\.zip)" | ForEach-Object {
            $yaralinks[$matches[2]] = @{}
            $yaralinks[$matches[2]].filename = $matches[1]
            $yaralinks[$matches[2]].link = "https://github.com" + $matches[0]
        }

        $scriptblock = {
            [cmdletbinding()]
            Param($yaraht)
            $ErrorActionPreference = 'Stop'

            $yaradefinition = @'

