      description = "Detects error messages related to JDNI usage in log files that can indicate a Log4Shell / Log4j exploitation"
      author = "Florian Roth"
      reference = "https://twitter.com/marcioalm/status/1470361495405875200?s=20"
      date = "2021-12-10"
      modified = "2021-12-13"
      score = 70
   strings:
      $x1 = "FATAL log4j - Message: BadAttributeValueException: "
   condition:
      $x1
}


'@
        
            [string]$arch=[intPtr]::Size*8
            $FileName = "C:\Temp\yara\yara$arch.exe"
            $epoch = [int][double]::Parse((Get-Date -UFormat %s))
            $scriptlog = "scs_log_$epoch.txt"

            Write-Verbose "Creating directory C:\Temp\Yara"

            $null = New-Item -Name Yara -Path C:\Temp\ -ItemType Directory -Force -ErrorAction SilentlyContinue

            Push-Location C:\Temp\Yara

            Set-Content $scriptlog -Force -Value "$(get-date) Invoke-Log4jScan started"

            [Net.ServicePointManager]::SecurityProtocol = [Enum]::ToObject([Net.SecurityProtocolType], 3072)

            try{
                $msg = "Downloading $($yaraht[$arch].filename) from $($yaraht[$arch].link)"
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"
                Invoke-WebRequest $yaraht[$arch].link -OutFile "C:\Temp\$($yaraht[$arch].filename)"

                $msg = "Download successful, extracting yara$arch.exe"
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"
                Expand-Archive -LiteralPath "C:\Temp\$($yaraht[$arch].filename)" -DestinationPath . -Force
            }
            catch{
                Write-Warning "Error downloading yara files: $($_.exception.message)"
                Add-Content $scriptlog -Value "$(get-date) Download failed"
            }

            if(!(Test-Path $FileName)){
                $msg = "Download failed, creating EXE from base64 string"
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"

                #region Yara.exe b64 string 
                # [Convert]::ToBase64String([IO.File]::ReadAllBytes($FileName))
                $yarexe = ''
                #endregion

                try{
                    [IO.File]::WriteAllBytes($FileName, [Convert]::FromBase64String($yarexe))
                }
                catch{
                    Write-Warning "Error creating yara files: $($_.exception.message)"
                    break
                }
            }

            $msg = "Downloading yara definition"
            Write-Verbose $msg
            Add-Content $scriptlog -Value "$(get-date) $msg"

            $yaranew = (New-Object System.Net.WebClient).DownloadString('https://github.com/Neo23x0/signature-base/raw/master/yara/expl_log4j_cve_2021_44228.yar')

            if($yaranew){
                $yaradefinition = $yaranew
                $msg = "Downloading successful"
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"
            }
            else{
                $msg = "Downloading failed"
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"
            }

            Set-Content -Value $yaradefinition -Path yara.yar -Force

            try{
                $drivelist = $env:SystemDrive #(Get-WmiObject -Class Win32_logicaldisk | Where-Object {$_.DriveType -Match '2|3'  -and $_.FreeSpace}).DeviceID
            }
            catch{
                Write-Warning "Error getting drives: $($_.exception.message)"
                break
            }

            [string]$arch = [intPtr]::Size*8
            $detection = 0

            $msg = "Checking for Visual C++ redistributable" 
            Write-Verbose $msg
            Add-Content $scriptlog -Value "$(get-date) $msg"

            cmd /c "$filename -v >nul 2>&1"
            if ($LASTEXITCODE -ne 0) {
                $vcplus = 'C:\Temp\Yara\vc_redist.x64.exe'
                
                $msg = "Downloading vc_redist" 
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"

                try{
                    Invoke-WebRequest https://aka.ms/vs/16/release/VC_redist.x64.exe -UseBasicParsing -outfile vc_redist.x64.exe
                }
                catch{
                    Write-Warning "Error downloading VC_Redist.x64.exe: $($_.exception.message)"
                    break
                }

                $msg = "Installing vc_redist" 
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"

                .\vc_redist.x64.exe /q /norestart
                Start-Sleep -Seconds 5
            }

            $msg = "Log4j scan started" 
            Write-Verbose $msg
            Add-Content $scriptlog -Value "$(get-date) $msg"

            $msg = "====================================================="
            Write-Verbose $msg
            Add-Content $scriptlog -Value $msg
            
            $filelist = foreach($driveletter in $drivelist){
                $msg = "Searching $driveletter for *.jar, *.log, or *.txt files" 
                Write-Verbose $msg
                Add-Content $scriptlog -Value "$(get-date) $msg"

                foreach($directory in $(try{Get-ChildItem -Path "$driveletter\" -Directory -Force}catch{})){
                    try{Get-ChildItem -Path $directory.fullname -Recurse -Force -Include *.jar,*.log,*.txt | ForEach-Object FullName}catch{} 
                }
            }
            
            $msg = "Scanning files" 
            Write-Verbose $msg
            Add-Content $scriptlog -Force -Value $msg

            $jarfilelist = $filelist | Where-Object {$_ -match '\.jar$'}

            $percent = 0

            if($jarfilelist){
                $step = 100 / @($jarfilelist).count

                foreach ($jarfile in $jarfilelist) {

                    Write-Progress -Activity "Searching jar files for JndiLookup.class references" -Status "Current file: $jarfile" -PercentComplete ($percent += $step)

                    Add-Content $scriptlog -Value "$(get-date) Searching $_ for references to JndiLookup.class"

                    if (select-string -Quiet -Path $jarfile "JndiLookup.class"){
                        Write-Verbose "Jar file $jarfile contains references to JndiLookup.class" 

                        if (!(test-path .\L4Jdetections.txt -ErrorAction SilentlyContinue)){
                            set-content -path .\L4Jdetections.txt -Value "! CAUTION !`r`n$(get-date)"
                        }
                        Add-Content .\L4Jdetections.txt -Value "POTENTIALLY VULNERABLE JAR: $($jarfile)"
                        $detection=1
                    }
                }

                Write-Progress -Activity "Searching jar files for JndiLookup.class references" -Completed
            }
            
            $textfilelist = $filelist | Where-Object {$_ -notmatch '\.jar$'}

            if($textfilelist){
                $percent = 0
                $step = 100 / @($textfilelist).count

                foreach ($file in $textfilelist) {
                    if ($file -match 'CentraStage' -or $file -match 'L4Jdetections\.txt') {
                        continue
                    }

                    #add it to the logfile, with a pause for handling
                    try{
                        Add-Content $scriptlog -Value $file -ErrorAction Stop
                    }
                    catch{
                        Start-Sleep -Seconds 1
                        Add-Content $scriptlog -Value $file -ErrorAction SilentlyContinue
                    }

                    #scan it
                    clear-variable result -ErrorAction SilentlyContinue

                    Write-Progress -Activity "Scanning files for evidence of attacks" -Status "Current file: $file" -PercentComplete ($percent += $step)

                    try{
                        $result = . $filename `"yara.yar`" `"$file`" '-s'
                    }
                    catch{
                        Write-Warning "Error scanning $($file): $($_.exception.message)"
                    }

                    if ($result) {
                        Write-Warning "File $file shows evidence of attack attempts"

                        $detection=1

                        if (!(Test-Path .\L4Jdetections.txt -ErrorAction SilentlyContinue)){
                            Set-Content -path .\L4Jdetections.txt -Value "! CAUTION !`r`n$(get-date)"
                        }

                        Add-Content -path .\L4Jdetections.txt -Value "! INFECTION DETECTION !`r`n$(get-date)"
                        Add-Content .\L4Jdetections.txt -Value $result
                    }
                }
            }

            $msg = "Log4j scan finished"
            Write-Verbose $msg
            Add-Content $scriptlog -Value "$(get-date) $msg"

            [PSCustomObject]@{
                Computer   = $env:COMPUTERNAME
                Vulnerable = [bool]($detection)
                FileList   = $filelist
                Detections = if(Test-Path .\L4Jdetections.txt){Get-Content .\L4Jdetections.txt}else{"N/A"}
            }
    
            Add-Content $scriptlog -Value "$(get-date) Invoke-Log4jScan completed"

            Write-Verbose "Script log file located at c:\Temp\Yara\$scriptlog"

            if($detection){
                Write-Verbose "Vulnerable files/logs found at C:\Temp\Yara\L4Jdetections.txt"
            }
            else{
                Write-Host "No vulnerable files or signs of attack found!" -ForegroundColor Green
            }

            Pop-Location

        }
    }

    process{
        if($PSBoundParameters.ContainsKey('Verbose')){
            $originalvbpref = $VerbosePreference
            $VerbosePreference = 'Continue'
        }

        if($ComputerName){
            $params = @{
                ComputerName  = $ComputerName
                ScriptBlock   = $scriptblock
                OutVariable   = 'out'
                ArgumentList  = $yaralinks
                ErrorAction   = 'SilentlyContinue'
                ErrorVariable = '+errs'
                ThrottleLimit = 100
                Verbose = $PSBoundParameters.ContainsKey('Verbose')
            }

            Invoke-Command @params
        }
        else{
            try{
                . $scriptblock  $yaralinks
            }
            catch{
                Write-Warning "Error running script locally"
            }
        }

        if($originalvbpref){
            $VerbosePreference = $originalvbpref
        }
    }

    end{

    }
}

Invoke-Log4jScan -Verbose
pause
